drop table if exists customers;

create table customers (
	id VARCHAR(40) PRIMARY KEY,
	firstname VARCHAR(50) NOT NULL,
	lastname VARCHAR(50),
	gender VARCHAR(50),
	email VARCHAR(50) UNIQUE,
	phone VARCHAR(50) UNIQUE,
	address VARCHAR(50),
	city VARCHAR(50),
	state VARCHAR(50),
	country VARCHAR(50),
	avatar VARCHAR(50)
);
